import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import dataService from '../services/dataService';

const VehicleDetail = () => {
  const { id } = useParams();
  const navigate = useNavigate();
  const [vehicle, setVehicle] = useState(null);
  const [loading, setLoading] = useState(true);

  // Mock vehicles data (same as other components)
  const mockVehicles = [
    {
      _id: '1',
      name: 'Mercedes-Benz S-Class',
      category: 'luxury',
      description: 'Experience ultimate luxury with our premium Mercedes-Benz S-Class. This flagship sedan combines cutting-edge technology with unparalleled comfort.',
      pricePerDay: 299,
      year: 2023,
      status: 'available',
      image: 'https://images.unsplash.com/photo-1563720223185-11003d516935?ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80',
      features: ['Leather Interior', 'GPS Navigation', 'Bluetooth', 'Premium Sound System', 'Climate Control'],
      specifications: {
        engine: '3.0L V6 Turbo',
        transmission: 'Automatic',
        fuelType: 'Gasoline',
        seats: 5,
        doors: 4
      }
    },
    {
      _id: '2',
      name: 'BMW M4 Coupe',
      category: 'sports',
      description: 'Feel the thrill of driving with our high-performance BMW M4 Coupe. Pure driving excitement with track-ready performance.',
      pricePerDay: 399,
      year: 2023,
      status: 'available',
      image: 'https://images.unsplash.com/photo-1555215695-3004980ad54e?ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80',
      features: ['Sport Seats', 'Performance Brakes', 'Track Mode', 'Premium Audio', 'Carbon Fiber Trim'],
      specifications: {
        engine: '3.0L Twin-Turbo I6',
        transmission: 'Manual/Automatic',
        fuelType: 'Gasoline',
        seats: 4,
        doors: 2
      }
    },
    {
      _id: '3',
      name: 'Range Rover Evoque',
      category: 'suv',
      description: 'Conquer any terrain with style in our luxurious Range Rover Evoque. Perfect blend of luxury and capability.',
      pricePerDay: 249,
      year: 2023,
      status: 'available',
      image: 'https://images.unsplash.com/photo-1606664515524-ed2f786a0bd6?ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80',
      features: ['All-Wheel Drive', 'Terrain Response', 'Panoramic Roof', 'Premium Interior', 'Advanced Safety'],
      specifications: {
        engine: '2.0L Turbo I4',
        transmission: 'Automatic',
        fuelType: 'Gasoline',
        seats: 5,
        doors: 5
      }
    },
    {
      _id: '4',
      name: 'Tesla Model S',
      category: 'luxury',
      description: 'Experience the future of driving with our Tesla Model S. Zero emissions, maximum performance.',
      pricePerDay: 349,
      year: 2023,
      status: 'available',
      image: 'https://images.unsplash.com/photo-1560958089-b8a1929cea89?ixlib=rb-1.2.1&auto=format&fit=crop&w=800&q=80',
      features: ['Autopilot', 'Supercharging', 'Premium Interior', 'Over-the-Air Updates', 'Mobile Connectivity'],
      specifications: {
        engine: 'Electric Motor',
        transmission: 'Single Speed',
        fuelType: 'Electric',
        seats: 5,
        doors: 4
      }
    }
  ];

  useEffect(() => {
    // Fetch vehicle from centralized data service
    const fetchVehicle = async () => {
      try {
        setLoading(true);
        const vehicleData = await dataService.getVehicleById(id);
        setVehicle(vehicleData);
      } catch (error) {
        console.error('Error fetching vehicle:', error);
      } finally {
        setLoading(false);
      }
    };

    fetchVehicle();
  }, [id]);

  const handleBookNow = () => {
    const token = localStorage.getItem('token');
    if (!token) {
      navigate('/login');
      return;
    }
    navigate(`/book/${id}`);
  };

  if (loading) {
    return (
      <div className="container py-5">
        <div className="text-center">
          <div className="spinner-border text-primary" role="status">
            <span className="visually-hidden">Loading...</span>
          </div>
          <p className="mt-3">Loading vehicle details...</p>
        </div>
      </div>
    );
  }

  if (!vehicle) {
    return (
      <div className="container py-5">
        <div className="text-center">
          <h2>Vehicle Not Found</h2>
          <p>The vehicle you're looking for doesn't exist.</p>
          <button className="btn btn-primary" onClick={() => navigate('/')}>
            Back to Home
          </button>
        </div>
      </div>
    );
  }

  return (
    <div className="container py-5">
      <div className="row">
        {/* Vehicle Image */}
        <div className="col-lg-8 mb-4">
          <div className="card">
            <img
              src={vehicle.image}
              alt={vehicle.name}
              className="card-img-top"
              style={{ height: '400px', objectFit: 'cover' }}
            />
          </div>
        </div>

        {/* Vehicle Info & Booking */}
        <div className="col-lg-4 mb-4">
          <div className="card h-100">
            <div className="card-body">
              <h1 className="card-title h3">{vehicle.name}</h1>
              <p className="text-muted mb-3">{vehicle.year} â€¢ {vehicle.category.charAt(0).toUpperCase() + vehicle.category.slice(1)}</p>

              <div className="mb-3">
                <span className={`badge ${vehicle.status === 'available' ? 'bg-success' : 'bg-danger'}`}>
                  {vehicle.status === 'available' ? 'Available' : 'Not Available'}
                </span>
              </div>

              <div className="mb-4">
                <h4 className="text-primary">${vehicle.pricePerDay}<small className="text-muted">/day</small></h4>
              </div>

              <button
                className="btn btn-primary w-100 mb-3"
                disabled={vehicle.status !== 'available'}
                onClick={handleBookNow}
              >
                <i className="fas fa-car me-2"></i>
                {vehicle.status === 'available' ? 'Book Now' : 'Not Available'}
              </button>

              <button
                className="btn btn-outline-secondary w-100"
                onClick={() => navigate('/')}
              >
                <i className="fas fa-arrow-left me-2"></i>
                Back to Vehicles
              </button>
            </div>
          </div>
        </div>
      </div>

      {/* Vehicle Details */}
      <div className="row mt-4">
        <div className="col-12">
          <div className="card">
            <div className="card-body">
              <h3 className="card-title">Vehicle Details</h3>

              {/* Description */}
              <div className="mb-4">
                <h5>Description</h5>
                <p>{vehicle.description}</p>
              </div>

              {/* Features */}
              <div className="mb-4">
                <h5>Features</h5>
                <div className="row">
                  {vehicle.features?.map((feature, index) => (
                    <div key={index} className="col-md-6 col-lg-4 mb-2">
                      <i className="fas fa-check text-success me-2"></i>
                      {feature}
                    </div>
                  ))}
                </div>
              </div>

              {/* Specifications */}
              <div className="mb-4">
                <h5>Specifications</h5>
                <div className="row">
                  <div className="col-md-6">
                    <table className="table table-borderless">
                      <tbody>
                        <tr>
                          <td><strong>Engine:</strong></td>
                          <td>{vehicle.specifications?.engine}</td>
                        </tr>
                        <tr>
                          <td><strong>Transmission:</strong></td>
                          <td>{vehicle.specifications?.transmission}</td>
                        </tr>
                        <tr>
                          <td><strong>Fuel Type:</strong></td>
                          <td>{vehicle.specifications?.fuelType}</td>
                        </tr>
                      </tbody>
                    </table>
                  </div>
                  <div className="col-md-6">
                    <table className="table table-borderless">
                      <tbody>
                        <tr>
                          <td><strong>Seats:</strong></td>
                          <td>{vehicle.specifications?.seats}</td>
                        </tr>
                        <tr>
                          <td><strong>Doors:</strong></td>
                          <td>{vehicle.specifications?.doors}</td>
                        </tr>
                        <tr>
                          <td><strong>Year:</strong></td>
                          <td>{vehicle.year}</td>
                        </tr>
                      </tbody>
                    </table>
                  </div>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
  );
};

export default VehicleDetail;
